import {
    YDATALOADED,
    YDATALOADING
  } from '../actions/types';

  const initialState = {
    isLoading: false,
  };

  export default function (state = initialState, action) {
    switch (action.type) {
      case USER_LOADED:
        return {
          ...state,
          isLoading: false,
          ydata: action.payload,
        };
      default:
        return state;
    }
  }
